import Event from "./Event";

const Events = () =>
{
    const event = [
        {name: 'Линейка', date: '01.09.2023', time: '09:00', descripsion: 'Долгожданная линейка первоклассников', place: 'Задний двор школы'}
    ]
    return (
        <div>
            <Event name ={event.at(0).name} date = {"01.09.2023"}
            time = {"09:00"} descripsion = {"Долгожданная линейка первоклассников!!!"}
            place = {"Задний двор школы"}/>
        </div>
    )
}

export default Events;
